import React from "react";
import Drawer from "./components/drawer";

class App extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        center={{ lat: 18.5204, lng: 73.8567 }}
        height="300px"
        zoom={15}
      />
    );
  }
}
